import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="nav">
        <div className="left-section">
          <h1>Blog</h1>
        </div>
        <div className="left-section">
          <ul>
            <li>Create post</li>
            <li>Posts</li>
          </ul>
        </div>
      </div>

      <div className="create"></div>
    </div>
  );
}

export default App;
